function WordList(props) {
  console.log(this.props.wordList);
  const wordListElt = this.props.wordList.map((elt, idx) =>
    <li key={idx}>{elt}</li>
  )

  return (
    <ul>{wordListElt}</ul>
  );
}

export default WordList;
